import React from "react";

const FullStory = props => {
  let id = props.match.params.id;
  let story = props.newsString.filter(story => story.id === id);
  console.log(story);
  return (
    <div>
      <h1>Full Story</h1>
    </div>
  );
};

export default FullStory;
